import Signup from "./components/Signup";
import "./firebase.js";

function App() {
  return (
    <>
      <div className="App">
        <h2>회원가입하기</h2>
        <Signup /> {/* 회원가입 컴포넌트 렌더링 */}
      </div>
    </>
